original_question:
त्रिभुज $ABC$ समद्विबाहु छ, जहाँ $AB=AC$ र उचाइ $AM=11$ छ। मानौं कि $\overline{AM}$ मा $D$ बिन्दु छ जहाँ $AD=10$ र $\angle BDC=3\angle BAC$ छ। त्रिभुज $ABC$ को परिमाप पत्ता लगाउनुहोस्।

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

